import React, {useState} from "react";
import ItemParts from "../components/Item/ItemParts";

function SearchedItem(){
    const [category, setCategory] = useState('');

    return(
        <div>
            <h1>Searched for: {category}</h1>
            <ItemParts/>
        </div>
    )
}

export default SearchedItem;
